import React from 'react'

const ReadOnlyRow = ({ contact, handleEditClick }) => {
    return (
        <tr>
            <td>{contact.fullName}</td>
            <td>{contact.address}</td>
            <td>{contact.phoneNumber}</td>
            <td>{contact.email}</td>
            <td>

            </td>
        </tr>
    );
};

export default ReadOnlyRow
